import React from 'react';
import './Product.style.scss';

const Product = (props) => {
    console.log(props);

    const renderProductImg = () => {
        const { product: { image_url, name }, isLoading } = props;

        return (
            <img
              className='Image'
              src={ image_url || '' }
              alt={ name }
              title={ name }
              loading="lazy"
            />
        );
    }

    return (
        <>
            <div className='Product'>
                { renderProductImg() }
            </div>
        </>
    );
};

export default Product;
